import React from "react";
const Memberpage = () => {
  return (
    <div>
      <div className="container">
        <div className="centrer">
          <p>
            <b>
              <d>Bienvenue dans le Shop de JapaShop !</d>
            </b>
          </p>
          <br></br>
          <img src="./newmember2.gif"></img>
        </div>
      </div>
    </div>
  );
};

export default Memberpage;
